//***************** PS2 Function Definition *****************//

int input_mux(char key_byte) {
	if (key_byte == 0x16) return 1;
	if (key_byte == 0x1E) return 2;
	if (key_byte == 0x26) return 3;
	if (key_byte == 0x25) return 4;
	if (key_byte == 0x2E) return 5;
	if (key_byte == 0x36) return 6;
	if (key_byte == 0x3d) return 7;
	if (key_byte == 0x3E) return 8;
	if (key_byte == 0x46) return 9;
	if (key_byte == 0x45) return 10;
	if (key_byte == 0x4E) return 11;
	if (key_byte == 0x2d) return -1; // click on R
  if (key_byte == 0x29) return START; //click on space
	if (key_byte == 0x5A) return NEXT; //click on space
	return 0; 
};

//***************** Audio Function Definition *****************//

void audio_playback_mono(const int *samples, int n) {
  int i;
  audiop->control = 0x8; // clear the output FIFOs
  audiop->control = 0x0; // resume input conversion
  for (i = 0; i < n; i++) { // output a sample per iteration
    // wait until there is space at the output FIFOs
    while (audiop->wsrc == 0);
    audiop->ldata = samples[i];
    audiop->rdata = samples[i];
    }
}     
